import React from 'react'
import { Link } from "react-router-dom";

export default function NavBar(props){
    return(
        <nav className="navbar">
            <Link to="/">
                <p name="next" variant="outlined"> Home </p>
            </Link>
            <Link to="/Campaigns">
                <p name="next" variant="outlined"> Campaigns </p>
            </Link>
        </nav>
    )
}
